string word[WORD_CNT];
result match_result[WORD_CNT][WORD_CNT];

void logtime(string message=""){
	static int stamp=0;
	cerr<<message<<" "<<clock()*1000/CLOCKS_PER_SEC-stamp<<"ms\n";
	stamp=clock()*1000/CLOCKS_PER_SEC;
}

int indent_cnt=0;
void addindent(){indent_cnt++;}
void delindent(){indent_cnt--;}
void indent(){
	for(int i=0;i<indent_cnt;i++){
		cerr<<"*   ";
	}
}

result trans(string res){
	result tmp=0;
	for(int i=0;i<5;i++){
		tmp*=3;
		switch(res[i]){
			case '-':{tmp+=0;break;}
			case 'g':{tmp+=1;break;}
			case 'y':{tmp+=2;break;}
			default:{cerr<<"#ERROR! result not recognized\n";}
		}
	}
	return tmp;
}

void init_match(){
	for(int ans=0;ans<WORD_CNT;ans++){
		for(int nw=0;nw<WORD_CNT;nw++){
			string res="-----";
			for(int i=0;i<5;i++){
				if(word[ans][i]==word[nw][i]){
					res[i]='g';
				}
			}
			for(int i=0;i<5;i++){ // match ith in ans
				if(res[i]!='g'){
					for(int j=0;j<5;j++){ // search in nw
						if(res[j]=='-'){
							if(word[ans][i]==word[nw][j]){
								res[j]='y';
								break;
							}
						}
					}
				}
			}
		//	cerr<<"ans="<<word[ans]<<", guess="<<word[nw]<<", res="<<res<<endl;
			match_result[ans][nw]=trans(res);
		}
	}
}


